// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract CryptoFashionToken is ERC20 {
    struct Order {
        string orderId;
        uint256 amount;
    }
    address public admin;

    event PaymentDone(
        address payer,
        uint256 amount,
        string orderId,
        uint256 date
    );

    constructor(address adminAddress) ERC20("CryptoFashionToken", "CFT") {
        admin = adminAddress;
    }

    function buyWithOrderArr(
        uint256 total,
        Order[] memory orders
    ) public payable returns (bool) {
        require(orders.length > 0, "Orders must be greater than 0.");
        require(msg.value == total, "Invalid amouunt.");
        _mint(msg.sender, msg.value);
        approve(msg.sender, msg.value);
        transferFrom(msg.sender, admin, msg.value);
        for (uint256 i = 0; i < orders.length; i++) {
            emit PaymentDone(
                msg.sender,
                orders[i].amount,
                orders[i].orderId,
                block.timestamp
            );
        }
        return true;
    }

    function deposit(uint256 amount) public payable {
        _mint(msg.sender, amount);
    }
}
